import React from 'react';
import ProjectHeader from '../components/ProjectHeader';
import ProjectDesc from '../components/ProjectDesc';
import ProjectPic from '../components/ProjectPic';


const Tottot = () => {
    return (
        <>
            <ProjectHeader
                project="tottot - question game"
                desc="UX/UI Design and fullstack development"
                tools="Tools: codeIgniter, phpmyadmin, SQL, Visual Studio Code"
                text="Do you and your friends talk about the same things over and over again? Let's not. Tottot is a game with questions to create discussion. Let's play!"></ProjectHeader>
            <ProjectPic src="./tottotiphone.png"></ProjectPic>
            <ProjectDesc
                desc="goal for the project"
                text="This game started of as a project for the course Databases and Web based systems. "></ProjectDesc>
            <ProjectDesc
                desc="the process"
                text=""></ProjectDesc>
            <ProjectPic src="./tfniphone.png"></ProjectPic>
            <ProjectDesc
                desc="the outcome"
                text="..."></ProjectDesc>


        </>
    );
};

export default Tottot;
